CREATE TABLE IF NOT EXISTS "Clientes" ("id" INTEGER PRIMARY KEY AUTOINCREMENT, "Codigo_Cliente" TEXT, "Nombre_completo" TEXT, "Fecha_de_nacimiento" TEXT, "Dirección" TEXT, "Localidad_y_Código_postal" TEXT, "Teléfono" TEXT, "Correo_electrónico" TEXT, "Fecha_de_alta" TEXT, "Grupo_de_clientes" TEXT, "Fecha_Alta" DATETIME DEFAULT CURRENT_TIMESTAMP, "Fecha_Actualizacion" DATETIME DEFAULT CURRENT_TIMESTAMP);
